'ct105 ', '[{"link":"https://www.bilibili.com/video/BV1Gg411g7qk","name":"酷乐298w连点剑圣511"}]', 67, '[20]', NULL, NULL, NULL, NULL),(367, 250, 3, NULL, 'ct106 第六天自己亲自指挥，11点开始出刀，现在是15:45，进度出完50刀，还剩34整刀，6尾刀，争取18点下班。第五天其实这一期的轴我们认为是相对好打一点的，大部分的轴都是在可控范围内，不像以往那样因为boss的miss之类的导致出现许多不可控的世界线，唯一不好的地方就是这次会战大多都是赌暴击，不暴击就寄或者不暴击就拉，但其实只要心态放平的话真没有以往那么难受，真正考验的是管理和指挥能力，对于成员来说确实是相对轻松的一期了。当然C5我们提供的法刀除外，那个女人真的属实难顶，但想必分出C5法刀的公会和玩家一定是没有办法三刀物理吧？这也是没办法的事情了，没能给大家提供安全稳定的刀型和轴，让大家这期依旧需要面对风险，我个人深感抱歉。会战还有两天，大家一起加油吧！第四天（睡前）花舞芳文00:22报完最后一刀，没有排什么C1法刀C3春猫，打的最稳成刀率最高的分刀，一天6圈整，都不用改排刀，明天早八人睡醒直接合刀出刀。分刀器是个好东西，真的建议你们学会用它。第三天先让我想想今天扯什么话题。好像暂时没什么好扯的，花舞组希望能多来点产轴人加入，包括但不限于全新轴、优化轴、整活轴，只要有且有一定使用价值的轴都是好轴。哦对了还记得第二天晚上跟你们说中排如果打不出轴那也要尽快出完刀吗？花舞芳文这边因为从18点开始研究C面分刀然后产轴然后一直摸到23点才开始出剩下的刀，结果到了凌晨4:40的时候还有6刀没出完，为了不掉刀只好用半AUTO的DD刀快速冲完C2C3，原本有机会捅一下200会屁股的，希望无了；然后昨天还被大家这几天听说的模拟器bug整掉了一刀90s满补刀。第二天本期开始着重快速出刀然后产轴，所以花舞芳文(一会)的分刀不会排那些需要筛的刀，基本围绕三物理为主，再来几刀法刀作为尾刀补充——以后我们的定位就是如此，躺201摆烂顺出，多出来的时间给大家产轴。只要不掉出600就完全无所谓了（昨天比600线要多10个完整刀的伤害怎样才能掉出600？）', '[{"link":"https://www.bilibili.com/video/BV1L44y1B7fr","name":"花舞-Daemonlucifer 251w"}]', 67, '[20]', NULL, NULL, NULL, NULL),(368, 350, 3, NULL, 'C101 公会战作业表的视频录入，B站搜索关键词是【会战】，如果有好的视频轴想要被录入，请在视频标题或者标签处标注【会战】，或主动投稿到作业表。非常感谢茶会以及其他UP主的辛苦付出ct104 ', '[{"link":"https://docs.qq.com/sheet/DSXFqV2t5T0tBRlhj?tab=p05l92","name":"茶会外放轴（中间）参考伤害354w"},{"link":"https://www.bilibili.com/video/BV14v411p7tu","name":"萌游姬349w视频有轴"},{"link":"https://www.bilibili.com/video/BV1Gg411g7qk","name":"酷乐314w连点情姐"}]', 67, '[10,20]', NULL, NULL, NULL, NULL),(369, 340, 3, NULL, 'C102 ct103 ct108 ', '[{"link":"https://docs.qq.com/sheet/DSXFqV2t5T0tBRlhj?tab=p05l92","name":"茶会外放轴（底下）参考伤害343.5w"},{"link":"https://www.bilibili.com/video/BV1ZQ4y197Nd?p=4","name":"酒落花下325w"},{"link":"https://www.bilibili.com/video/BV1XB4y1T79c?p=2","name":"玩具喵半auto\n305w"},{"link":"https://www.bilibili.com/video/BV1L44y1B7fr","name":"花舞-Daemonlucifer 282w"}]', 67, '[10,20]', NULL, NULL, NULL, NULL),(370, 300, 3, NULL, 'C100 5星安可以在此处解决花舞-无糖加冰5★安轴ct102 ', 